import React, {Component} from 'react';

export default class HeaderLogo extends Component {
    render(){
        return(
            <p style={{fontFamily: 'Roboto', fontSize: 26, flexDirection: 'column', display: 'flex', lineHeight: 1}}>
              <span>
                <span style={{color: 'red'}}>N</span>
                <span style={{color: 'green'}}>O</span>
                <span style={{color: 'pink'}}>V</span>
                <span style={{color: 'gray'}}>A</span>
                <span style={{color: 'blue'}}>S</span>
              </span>
              <span style={{fontSize: 14, textDecoration: 'overline', display: 'flex', justifyContent: 'flex-end'}}>Logo</span>
            </p>
        );
    }
}
